import { mapGetters } from "vuex";

export default {
  name: "SellerInventoryComponent",
  data() {
    return {
  }
},
  methods: {
    viewProducts() {
      this.$router.push({
        path: "/sellerdashboard/products",
      });
    },
  },

  computed: {
    ...mapGetters({
      Seller: "getSellerById",
    }),
  },
};
